### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Discrete Random Variables**
- **Uniform Distribution (A)**
  - PMF: \( f_X(k) = \frac{1}{b-a+1} \) for \( a \leq k \leq b \)
  - CDF: \( F_X(x) = \begin{cases} 0 & x < 0 \\ \frac{k-a+1}{n} & k \leq x < k+1 \\ 1 & x \geq n \end{cases} \)
  - Expected Value: \( E[X] = \frac{a+b}{2} \)
  - Variance: \( \text{Var}(X) = \frac{n^2-1}{12} \)

- **Bernoulli Distribution (p)**
  - PMF: \( f_X(k) = \begin{cases} p & x = 1 \\ 1-p & x = 0 \end{cases} \)
  - CDF: \( F_X(x) = \begin{cases} 0 & x < 0 \\ 1-p & 0 \leq x < 1 \\ 1 & x \geq 1 \end{cases} \)

#### 2. **Exponential Distribution**
- **Probability Density Function (PDF):** \( f(x) = \lambda e^{-\lambda x} \)
- **Cumulative Distribution Function (CDF):** \( F(x) = 1 - e^{-\lambda x} \)
- **Expected Value:** \( E[X] = \frac{1}{\lambda} \)
- **Variance:** \( \text{Var}(X) = \frac{1}{\lambda^2} \)

#### 3. **Probability Mass Function (PMF)**
- **Definition:** \( P(X = x) \)
- **Example:** For a random variable \( X \) taking values from 1 to 10 with equal probability \( \frac{1}{10} \), and \( Y = X \mod 4 \):
  - \( P(Y = 0) = \frac{1}{5} \)
  - \( P(Y = 1) = \frac{3}{10} \)
  - \( P(Y = 2) = \frac{3}{10} \)
  - \( P(Y = 3) = \frac{1}{5} \)

#### 4. **Expected Value and Variance**
- **Expected Value:** \( E[X] = \sum x P(X = x) \)
- **Variance:** \( \text{Var}(X) = E[X^2] - (E[X])^2 \)

#### 5. **Conditional Probability**
- **Definition:** \( P(A|B) = \frac{P(A \cap B)}{P(B)} \)
- **Example:** Given a CDF \( F(x) \), the conditional probability that \( X > 0.9 \) given \( X > 0.7 \) is:
  \[
  P(X > 0.9 | X > 0.7) = \frac{P(X > 0.9)}{P(X > 0.7)} = \frac{1 - F(0.9)}{1 - F(0.7)}
  \]

#### 6. **Joint PMF and Marginal PMF**
- **Joint PMF:** \( P(X = x, Y = y) \)
- **Marginal PMF:** \( P(X = x) = \sum_y P(X = x, Y = y) \)
- **Example:** For a joint PMF table, calculate \( P(X = Y) \) and other probabilities.

#### 7. **Probability Density Function (PDF) and Cumulative Distribution Function (CDF)**
- **PDF:** \( f_X(x) \)
- **CDF:** \( F_X(x) = \int_{-\infty}^{x} f_X(t) \, dt \)
- **Example:** For \( f_X(x) = cx^2(1-x) \) for \( 0 \leq x \leq 1 \):
  - Find \( c \) such that \( \int_{0}^{1} cx^2(1-x) \, dx = 1 \)
  - Calculate the CDF \( F_X(x) \)

#### 8. **Markov and Chebyshev Inequalities**
- **Markov Inequality:** \( P(X \geq a) \leq \frac{E[X]}{a} \)
- **Chebyshev Inequality:** \( P(|X - \mu| \geq k\sigma) \leq \frac{1}{k^2} \)

#### 9. **Binomial Distribution**
- **PMF:** \( P(X = k) = \binom{n}{k} p^k (1-p)^{n-k} \)
- **Expected Value:** \( E[X] = np \)
- **Variance:** \( \text{Var}(X) = np(1-p) \)

